import React from 'react';

const Login = () => {
    return (
        <>
           <div className='login-wrapper'>
              <h2>User Login</h2>
              <div>
                <form>
                 <input
                  placeholder='Enter Your Name or Phone'
                  name='name'
                  type='text'
                  onChange={(e)}                 
                  > 
                 </input>
                
                
                
                </form>

              </div>
           </div> 
        </>
    );
}

export default Login;
